import React, { Component } from 'react';
import { Button, FormGroup } from 'reactstrap';

export class Create extends Component {
    constructor(props){
        super(props);
        this.state = {
            who: '',
            what: '',
            where: '',
            when: '',
        }
    }
    render(){
        return (
            <div className="form-group">
                    <form onSubmit={this.onSubmit}>
                <FormGroup>
                        <div>
                            <label>Who</label>
                            <input type="text"/>
                        </div>
                        <div>
                            <label>What</label>
                            <input type="text"/>
                        </div>
                        <div>
                            <label>Where</label>
                            <input type="text"/>
                        </div>
                        <div>
                            <label>When</label>
                            <input type="text"/>
                        </div>
                        <div>
                            <Button type="submit" color="danger">Create</Button>
                        </div>
                </FormGroup>
                    </form>
            </div>
        )
    }
}

export default Create;
